import React, { Component } from "react";
import firebase from "firebase/app";


export default class Chart extends Component {

    render() {
        let options = {
            scales: {
                xAxes: [{
                    barPercentage: 0.5,
                    barThickness: 6,
                    maxBarThickness: 8,
                    minBarLength: 2,
                    gridLines: {
                        offsetGridLines: true
                    }
                }]
            }
        };
        let myBarChart = new Chart(ctx, {
            type: 'bar',
            data: data,
            options: options
        });
        return(
            <div>
                {myBarChart}
            </div>
        );
    }
}
